import React from 'react';
import NewInput from './../Input/NewInput';
import NewButton from './../Button/NewButton';

const NewForm = ([setArr]) => {
	return (
		<div>
			<NewInput/>
			<NewButton on={setArr}/>
		</div>
	);
}

export default NewForm;
